import React from "react";

interface Props {
  title: string;
  text: string;
}

class RollingBannerComponent extends React.Component<Props> {
  render(): React.ReactNode {
    const {title, text} = this.props;
    return (
      <div className="bg-white w-full flex h-10 mt-2 p-4 items-center">
        <div>{title}</div>
        <div>
          <ul>
            <li className="flex gap-2 items-center">
              <div className="font-bold text-sm">12분전</div>
              <div>신성델타테크는 별로네</div>
              <div className="font-bold text-sm">test</div>
            </li>
          </ul>
        </div>
      </div>
    );
  }
}

export default RollingBannerComponent;
